description:
Windows 10 The Complete Manual {{ERTB}} 


http://i.imgur.com/raYeSsj.jpg

The Start menu is back! Windows 8 was a massive departure from the operating system we all knew and loved, but Windows 10 takes the best parts of Windows 8, and merges them elegantly with the best parts of Windows 7 to create Microsofts most loved OS to date. With the introduction of Cortana, you new voice assistant, and with the brand-new web browser, Edge, Windows has never been a stronger platform! Enjoy the book
